class Solution:
	def repeatedSubstringPattern(self, s: str):
		for i in range(len(s)):
			num = s.count(s[:i+1])
			if num * len(s[:i+1]) == len(s):
				if num > 1:
					return True
		return False


sol = Solution()
stringTrue = "pepperpepper"
stringFalse = "pepperpepp"
runtimeerror = ""
